INSERT INTO `client_messagetranslation` VALUES (3388,'AIR','<h3>?Anu?u 2:E koho i kekahi la a i ?ole ka palapala ho?ike ho?omaopopo a me ka palapala ho?ike mua aku</h3><p>(Mana?o:Ina koho ?oe & nana ma ka la ho?ike palapala ho?ike, a puka ana ka ?alemanaka.Hiki ia?oe ke kaomi i ka < a i ?ole > ?ihe ma ka ?alemanaka no ka nana ?ana i kela mahina aku nei a pela aku a i ?ole na mahina ma mua a?e o kela.Kaomi i ka la no ke kukulu ?ana i palapala ho?ike no kela la.)</p>','HAW','--ANY--','--ANY--','˙INSERT INTO `client_messagetranslation` VALUES (2444,'AIR','Reproducir/Pausa','ESN','--ANY--','--ANY--',' !IoIŒ@BÄJAS‚ä\nR','2013-08-01 11:02:31.780');
